import React from 'react';

const stats = [
  { label: '+120% 5-Star Reviews', color: 'bg-blue-400', icon: 'â­', style: 'top-2 left-1/2 -translate-x-1/2' },
  { label: '+180% Phone Calls', color: 'bg-yellow-300', icon: 'ðŸ“ž', style: 'top-20 right-0 md:right-8' },
  { label: '+200% Direction Requests', color: 'bg-primary-300', icon: 'ðŸ“', style: 'bottom-24 right-0 md:right-8' },
  { label: '+60% Bookings', color: 'bg-green-400', icon: 'ðŸ“…', style: 'bottom-8 left-0 md:left-8' },
  { label: '+90% Posts Engagement', color: 'bg-primary-400', icon: 'ðŸ“', style: 'top-1/2 left-0 -translate-y-1/2' },
];

const ServiceStatsVisual = () => (
  <div className="relative flex justify-center items-center py-8">
    {/* Subtle city/map background */}
    <svg className="absolute left-1/2 top-1/2 -translate-x-1/2 -translate-y-1/2 opacity-10 z-0" width="600" height="400" viewBox="0 0 600 400" fill="none">
      <ellipse cx="300" cy="200" rx="280" ry="120" fill="#5fffd7" />
      <rect x="100" y="250" width="60" height="80" rx="10" fill="#e6fffa" />
      <rect x="440" y="230" width="80" height="100" rx="12" fill="#e6fffa" />
      <rect x="200" y="300" width="100" height="60" rx="10" fill="#e6fffa" />
      <circle cx="500" cy="120" r="18" fill="#5fffd7" />
      <circle cx="120" cy="100" r="12" fill="#5fffd7" />
    </svg>
    {/* Phone SVG illustration with Google search UI */}
    <div className="relative z-10">
      <svg width="260" height="480" viewBox="0 0 260 480" fill="none" xmlns="http://www.w3.org/2000/svg" className="drop-shadow-xl">
        {/* Phone body */}
        <rect x="10" y="10" width="240" height="460" rx="40" fill="#222" />
        {/* Screen */}
        <rect x="30" y="60" width="200" height="360" rx="24" fill="#fff" />
        {/* Search bar */}
        <rect x="45" y="80" width="170" height="28" rx="14" fill="#f3f4f6" />
        <text x="60" y="99" fontSize="13" fill="#888">businesses near me</text>
        {/* Map preview */}
        <rect x="45" y="115" width="170" height="40" rx="8" fill="#e6fffa" />
        <rect x="50" y="120" width="60" height="30" rx="6" fill="#b3ffe9" />
        <rect x="120" y="120" width="90" height="30" rx="6" fill="#80ffec" />
        {/* Business card */}
        <rect x="45" y="165" width="170" height="90" rx="12" fill="#f9fafb" />
        {/* Stars */}
        <text x="60" y="185" fontSize="14" fill="#222">Your Business</text>
        <text x="60" y="202" fontSize="13" fill="#FFD700">â˜…â˜…â˜…â˜…â˜…</text>
        <text x="120" y="202" fontSize="12" fill="#888">(1.3K)</text>
        <text x="60" y="218" fontSize="11" fill="#888">Brunch Â· 2431 Main St</text>
        <text x="60" y="232" fontSize="10" fill="#5fffd7">"Delicious, creative menu, fun friendly staff, and beautiful setting."</text>
        {/* Action buttons */}
        <rect x="55" y="245" width="40" height="18" rx="8" fill="#5fffd7" />
        <rect x="105" y="245" width="50" height="18" rx="8" fill="#e6fffa" />
        <rect x="165" y="245" width="40" height="18" rx="8" fill="#e6fffa" />
        <text x="65" y="258" fontSize="10" fill="#222">Call</text>
        <text x="115" y="258" fontSize="10" fill="#222">Directions</text>
        <text x="175" y="258" fontSize="10" fill="#222">Website</text>
        {/* Home button */}
        <circle cx="130" cy="420" r="18" fill="#5fffd7" />
        {/* Speaker */}
        <rect x="110" y="30" width="40" height="8" rx="4" fill="#444" />
      </svg>
      {/* Stat bubbles, closer to phone */}
      {stats.map((stat, i) => (
        <div
          key={stat.label}
          className={`absolute ${stat.style} px-4 py-2 rounded-full text-xs font-bold text-gray-900 shadow-lg flex items-center gap-1 ${stat.color}`}
          style={{ zIndex: 20 }}
        >
          <span>{stat.icon}</span> {stat.label}
        </div>
      ))}
    </div>
  </div>
);

export default ServiceStatsVisual;
